body { height: 50px; width: 50px; }
* { font-family: arial; }
div { height: 200%; }
.hoverContainer { height: 640px; width: 1040px; }
iframe { position: absolute; top: 0; left: 0; right: 0; height: 100%; border: none; }
.hoverContainer {
    background: black;
    border-radius: 28px;
    padding: 18px;
    display: flex;
    flex-direction: column;
    position: relative;
    margin-bottom: 12px;
    left: 100%;
    top: 100%;
    transform: translate(-50%, -50%);
}
.header_discrip { font-size: 21px; font-weight: 300; color: #6f6f6f; width: fit-content; }
.header {
    padding-bottom: 12px;
    width: 100%;
    height: 36px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: row;
}

* {
    font-family: 'Arial', sans-serif; /* 使用Arial字体，并设置备用字体 */
    color: #ff69b4; /* 全局字体颜色设置为粉色 */
    font-weight: bold; /* 全局字体加粗 */
}

body {
    background-color: #800080; /* 设置紫色背景 */
}

.startPage {
    position: absolute;
    width: auto;
    z-index: 0;
    transition: transform 0.3s ease;
}

.startPage:hover {
    transform: translateY(-5px); /* 鼠标悬停时轻微上移 */
}

.hoverContainer {
    background: #800080; /* 紫色背景 */
    border-radius: 27px;
    padding: 50px;
    display: flex;
    flex-direction: row;
    margin: 12px auto;
    position: relative;
    box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2); /* 添加阴影以增加层次感 */
}

.size-smallButton {
    font-size: 24px; /* 调整字体大小 */
    border-radius: 12px;
    height: 48px;
    min-width: 48px;
    display: flex;
    align-items: center;
    justify-content: center;
    width: auto;
    cursor: pointer;
    border: 2px solid #ff69b4; /* 粉色边框 */
    background-color: #800080; /* 紫色背景 */
    transition: all 0.3s ease; /* 过渡效果 */
    margin: 0 10px; /* 增加间距 */
}

.size-smallButton:hover {
    background-color: #ff69b4; /* 鼠标悬停时粉色背景 */
    color: #800080; /* 紫色文字 */
}

.style-input {
    background: #800080; /* 紫色背景 */
    padding: 12px;
    border: 2px solid #ff69b4; /* 粉色边框 */
    transition: all 0.3s ease; /* 过渡效果 */
}

.style-input:hover {
    border-color: #c080ff; /* 鼠标悬停时边框颜色 */
}

a:not(:first-child) {
    margin-left: 8px;
}

a {
    color: #ff69b4; /* 粉色链接颜色 */
    text-decoration: none; /* 去除下划线 */
    transition: color 0.3s; /* 过渡效果 */
}

a:hover,
a:hover .header_discrip {
    color: #c080ff !important; /* 鼠标悬停时更深的粉色 */
}
